        className="post__image"
        src="/Ekran-Resmi-2019-11-18-18.08.13.png"
        alt="wrong"
      />
      {/* image */}
      <h4>Username: caption</h4>
      {/* username + caption */}
    </div>
  );
}

export default Post;
